import React from 'react';
import styled from 'styled-components';

const DefaultFontStyle = styled.div`
  position: absolute;
  z-index: 1000;
  display: flex;
  align-items: center;
  justify-content: center;
  left: 40%;
  top: 40%;
  width: 200px;
  height: 100px;
  background: #ffffff;
  font-size: 12px;
  color: #000000;
  border: 1px solid black;
  border-radius: 0%;
  opacity: 1;
  padding: 5px;
  visibility: visible;
`;

export default function FontElement({ id, content, onClick, style }) {
  console.log('style - element 內收到的', style);
  return (
    <DefaultFontStyle key={id} id={id} style={style} onClick={onClick}>
      {content}
    </DefaultFontStyle>
  );
}
